import React from "react";
import Pim from "../Components/portfolio/Pim";
import PageHeader from "../Components/common/PageHeader";
import Spacer3 from "../Components/common/Spacer3";

function PimPage() {
  return (
    <>
    <Spacer3/>
    <PageHeader t
      title="metal"
    />
      <Pim/>
    </>
  );
}

export default PimPage;
